counter = 0

function NeverHit() {
    if (!UI.IsHotkeyActive("Script items", "Crook delta")) {
        if (UI.IsHotkeyActive("Misc", "JAVASCRIPT", "Script items", "Low delta")) {
            AntiAim.SetOverride(1);
            AntiAim.SetFakeOffset(0);
            if (UI.IsHotkeyActive("Anti-Aim", "Inverter")) {
                AntiAim.SetRealOffset(16);
            } else {
                AntiAim.SetRealOffset(-16);
            }
        } else
            AntiAim.SetOverride(0)
        return
    }
    inverted = (UI.IsHotkeyActive("Anti-Aim", "Fake angles", "Inverter")) ? -1 : 1;
    var a11 = -72 * inverted;
    var a12 = 49 * inverted;
    var a13 = 15 * inverted;
    var a21 = 16 * inverted;
    var a22 = 3 * inverted;
    var a23 = 20 * inverted;
    var a31 = 4 * inverted;
    var a32 = -4 * inverted;
    var a33 = -2 * inverted
    AntiAim.SetOverride(1);
    if (counter > 2) {
        counter = 0;
    }
    switch (counter) {
        case 0:
            AntiAim.SetRealOffset(a11)
            AntiAim.SetLBYOffset(a12)
            AntiAim.SetFakeOffset(a13)
            break;
        case 1:
            AntiAim.SetRealOffset(a21)
            AntiAim.SetLBYOffset(a22)
            AntiAim.SetFakeOffset(a23)
            break;
        case 2:
            AntiAim.SetRealOffset(a31)
            AntiAim.SetLBYOffset(a32)
            AntiAim.SetFakeOffset(a33)
    }
    counter++
}

