function VectorAngles(forward) {
    var angles;
    var tmp, yaw, pitch;

    if (forward[1] == 0 && forward[0] == 0) {
        yaw = 0;
        if (forward[2] > 0)
            pitch = 270;
        else
            pitch = 90;
    } else {
        yaw = (Math.atan2(forward[1], forward[0]) * 180 / Math.PI);
        if (yaw < 0)
            yaw += 360;
        tmp = Math.sqrt(forward[0] * forward[0] + forward[1] * forward[1]);
        pitch = (Math.atan2(-forward[2], tmp) * 180 / Math.PI);
        if (pitch < 0)
            pitch += 360;
    }

    x = pitch;
    y = yaw;
    z = 0;
    angles = [x, y, z];

    return angles;
}

